import React from "react";
import '../styles/Mens.css';
import cards from '../components/cards';

function Mens() {

  const menCards = cards.filter(card => card.gender === 'men');

  return(
    <div className="mens">
      <div className="mens-image-section"></div>
      <div className="mens-products">
      {menCards.map(card => (
        <div key={card.key}>
          <img src={card.src} alt={card.title} />
          <p className="price">${card.price}</p>
        </div>
      ))}
      </div>
    </div>
  )
}

export default Mens;
